import React, { Component } from "react";


export default class BackgroundImages extends Component {
  constructor() {
    this.state = {
      imgIndex: null
    };
  }

  image= [
    {
      headline: "Title 1",
      link: "www.example1.com"
    },
    {
      headline: "Title 2",
      link: "www.example2.com"
    },
    {
      headline: "Title 3",
      link: "www.example3.com"
    }
  ];

  componentWillMount() {
    this.displayRandomImage();
  }

  displayRandomImage = () => {
    this.setState({
      imgIndex: Math.floor(Math.random() * 3)
    });
  };

  render() {
    return (
      <div>
        <div id="slideshow" className="carousel slide" data-ride="carousel">
          <div className="carousel-inner">
            <div className="carousel-item active">
                <div className='carousel-image_title'>{this.images[imgIndex].headline}</div>
              <img
                className="d-block"
                src={this.images[imgIndex].link}
                alt="First slide"
              />
            </div>
          </div>
          <a
            className="carousel-control-prev"
            href="#carouselExampleControls"
            role="button"
            data-slide="prev"
          >
            <span className="carousel-control-prev-icon" aria-hidden="true"></span>
            <span className="sr-only">Previous</span>
          </a>
          <a
            className="carousel-control-next"
            href="#carouselExampleControls"
            role="button"
            data-slide="next"
          >
            <span className="carousel-control-next-icon" aria-hidden="true"></span>
            <span className="sr-only">Next</span>
          </a>
        </div>
      </div>
    );
  }
}
